import React from 'react';

const HomePage = (props) => {
    return(
        <div>
            <h3 align="center">{props.author}</h3>
            <image src={props.image} alt="" />
            <h3>{props.title}</h3>
            <h6>{props.content}</h6>
        </div>
    )
}
export default HomePage;
